description:
Verenigde Staten
Actie
89 minuten

goed

met Gabriel Macht, Robert Patrick en Kristanna Loken

LAPD Luitenant Paul Cutler wordt overgeplaatst naar Detroit om er een lokaal SWAT-team aan een training te onderwerpen. Hij 
wordt echter het nieuwe doelwit van een moorddadig genie dat beschermd wordt door overheidsfunctionarissen. Paul zal nu alles 
op alles moeten zetten om niet aan hem ten prooi te vallen.
